import { render } from "react-dom";

class Cases extends React.Component {
  state = {
    byState: "NC",
  };

  render() {
    //console.log(this.props.case);
    console.log(this.props.case.hospitalizedCurrently);
    console.log(this.props.case.positive);
    console.log(this.props.case.negative);
    console.log(this.props.case.lastUpdateEt);

    let list = "";

    if (this.byState === "NC") {
      list = (
        <li className="list-group-item">
          <div>
            Stats for North Carolina as of: {this.props.case.lastUpdateEt}.
          </div>
          <div>Positive cases: {this.props.case.positive}.</div>
          <div>Negative cases: {this.props.case.negative}.</div>
          <div>
            Hospitalized cases: {this.props.case.hospitalizedCurrently}.
          </div>
        </li>
      );
    }

    return (
      <div>
        <ul className="list-group">{list}</ul>
        <br />
        <select
          onChange={(e) => this.setState({ currency: e.target.value })}
          className="form-control"
        >
          <option value="USD">USD</option>
          <option value="GBP">GBP</option>
          <option value="EUR">EUR</option>
        </select>
      </div>
    );
  }
}

export default Cases;
